import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
  return (
    <>

      <div className="items-center justify-center flex pt-10">
        <Link to="/memory">
          <button className="bg-blue-500/80 w-20 h-8 rounded-lg">Memory</button>
        </Link>
      </div>

      <div>
        <h1>Memory Training Game</h1>
        <ul>
          <div className='h-12 w-48 justify-center items-center flex font-bold  '><li>Number</li></div>
          <div className='h-12 w-48 justify-center items-center flex font-bold  '><li>Words</li></div>
          <div className='h-12 w-48 justify-center items-center flex font-bold  '><li>Cards</li></div>
          <div className='h-12 w-48 justify-center items-center flex font-bold  '><li>Images</li></div>
          <div className='h-12 w-48 justify-center items-center flex font-bold  '><li>Names</li></div>
        </ul>
      </div>
    </>

  );
}
